const GestionCompte = () => {
    const [formVisible, setFormVisible] = useState(false);
    const [TableVisible, setTableVisible] = useState(false);
    const [activeBoxId, setActiveBoxId] = useState(null);
    const [currentPage, setCurrentPage] = useState(1);
    const [itemsPerPage] = useState(5); 
    const [users, setUsers] = useState([
      { id: 1, name: 'User 1', email: 'user1@example.com', password: 'password', role: 'role' },
      { id: 2, name: 'User 2', email: 'user2@example.com', password: 'password', role: 'role' },
      // Add more users as needed
    ]);
  
    // Calculate the last item on the current page
    const indexOfLastItem = currentPage * itemsPerPage;
    const indexOfFirstItem = indexOfLastItem - itemsPerPage;
    const currentItems = users.slice(indexOfFirstItem, indexOfLastItem);
  
    // Change page
    const paginate = (pageNumber) => setCurrentPage(pageNumber);
  
    const pageNumbers = [];
    for (let i = 1; i <= Math.ceil(users.length / itemsPerPage); i++) {
      pageNumbers.push(i);
    }
  
    const handleBoxClick = (boxId) => {
      setActiveBoxId(boxId);  // Sets the active box ID
  
      if (boxId === 'create') {
        setTableVisible(false);
        setFormVisible(true);  // Shows the form when a box is clicked
      } else if (boxId === 'manage') {
        setFormVisible(false);
        setTableVisible(true);  // Assumes there is a similar hook for table visibility
      }
      // No need for an else block if there are no other actions to perform
    };
  
    const handleSubmit = async (e) => {
      e.preventDefault();
      const formData = new FormData(e.target);
      const data = {
        name: formData.get('nom'),
        email: formData.get('email'),
        password: formData.get('password1'),
        role: formData.get('role'),
      };
  
      try {
        const response = await fetch('http://127.0.0.1:8000/api/register', {
          method: 'POST',
          headers: {
            'Content-Type': 'application/json',
          },
          body: JSON.stringify(data),
        });
  
        // Check if response is not ok
        if (!response.ok) {
          throw new Error('Network response was not ok');
        }
  
        // Check content type of the response
        const contentType = response.headers.get('content-type');
        if (contentType && contentType.includes('application/json')) {
          const result = await response.json();
          console.log(result);
        } else {
          // Handle non-JSON response (e.g., display an error message)
          console.error('Response was not JSON');
        }
      } catch (error) {
        console.error('Error:', error);
      }
    };
  
    return (
      <div className="GestionCompte">
        <div className={`container ${formVisible ? "smaller" : ""}`}>
          <div className={`box add ${activeBoxId === 'create' ? 'active' : ''} ${activeBoxId !== null ? 'active-top' : ''}`} onClick={() => handleBoxClick('create')}>
            <svg xmlns="http://www.w3.org/2000/svg" width="4em" height="4em" viewBox="0 0 24 24"><path fill="none" stroke="white" strokeLinecap="round" strokeLinejoin="round" strokeWidth={1.5} d="M17 10h3m3 0h-3m0 0V7m0 3v3M1 20v-1a7 7 0 0 1 7-7v0a7 7 0 0 1 7 7v1m-7-8a4 4 0 1 0 0-8a4 4 0 0 0 0 8"></path></svg>           
            <div>Cr√©er un utilisateur</div>
          </div>
          <div className={`box management ${activeBoxId === 'manage' ? 'active' : ''} ${activeBoxId !== null ? 'active-top' : ''}`} onClick={() => handleBoxClick('manage')}>
            <svg xmlns="http://www.w3.org/2000/svg" width="4em" height="5em" viewBox="0 0 2048 2048"><path fill="white" d="M1148 1152q-83-62-179-95t-201-33q-88 0-170 23t-153 64t-129 100t-100 130t-65 153t-23 170H0q0-120 35-231t101-205t156-167t204-115q-56-35-100-82t-76-104t-47-119t-17-129q0-106 40-199t110-162T569 41T768 0t199 40t162 110t110 163t41 199q0 66-16 129t-48 119t-76 103t-101 83q60 23 113 54v152zM384 512q0 80 30 149t82 122t122 83t150 30q79 0 149-30t122-82t-83-122t-149-30q-80 0-149 30t-122 82t-83 123t-30 150q0 79 30 149t82 122t122 83t150 30q79 0 149-30t122-82t-83-122t-30-150q0-79-30-149t-82-122t-123-83t-149-30q-80 0-149 30t-122 82t-83 123t-30 149m1664 768v768H1024v-768h256v-256h512v256zm-640 0h256v-128h-256zm512 384h-128v128h-128v-128h-256v128h-128v-128h-128v256h768zm0-256h-768v128h768z"></path></svg>  
            <div>Editer les comptes</div>
          </div>
        </div>
        {formVisible && (
          <form className="form" onSubmit={handleSubmit}>
            <div className="form-row">
              <div className="form-group">
                <label htmlFor="nom">Nom</label>
                <input id="nom" type="text" placeholder="Nom" required />
              </div>
              <div className="form-group">
                <label htmlFor="email">Adresse Email</label>
                <input id="email" type="email" placeholder="Adresse Email" required />
              </div>
            </div>
            <div className="form-row">
              <div className="form-group">
                <label htmlFor="role">Role</label>
                <input id="role" type="text" placeholder="Role" required />
              </div>
              <div className="form-group">
                <label htmlFor="password1">Mot de passe</label>
                <input id="password1" type="password" placeholder="Mot de passe" required />
              </div>
            </div>
            <button type="submit">Enregistrer</button>
          </form>
        )}
        {TableVisible && (
          <>
            <table className="user-table">
              <thead>
                <tr>
                  <th>Name</th>
                  <th>Email</th>
                  <th>Password</th>
                  <th>Role</th>
                  <th>Actions</th>
                </tr>
              </thead>
              <tbody>
                {currentItems.map(user => (
                  <tr key={user.id}>
                    <td>{user.name}</td>
                    <td>{user.email}</td>
                    <td>{user.password}</td>
                    <td>{user.role}</td>
                    <td>
